import React, { Component } from 'react';

class UserItem extends Component{
      state = {
      id: '1',
      login: 'Bojurie',
      avatar_url: '',
      html_url: 'https://github.com/Bojurie'
    }
  render(){
    return <div className="card text-center">
        <img src = {this.state.avatar_url} alt = '' className = 'round-img' style = {{
        width: '60px'}}/>
        <h3>{this.state.login}</h3>
        <a href={this.state.html_url} className='btn btn-dark btn-sm my-1' target='blank'>More</a>
      </div>;

  }
}
export default UserItem;
